import React from 'react'
import { Link } from 'react-router-dom'

export const Header = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
    <ul className="navbar-nav mr-auto">  
      <li><Link to={'/'} className="nav-link">Logout</Link></li>
      </ul>
      </nav>
  )
}
